import Dashboard from "./pages/dashboard/dashboard.jsx";
import Pedidos from "./pages/pedidos/pedidos.jsx";
import PedidosNovos from "./pages"
function Rotas(){
  return <BrowserRouter>
    <Routes>
      <Route path="/" element={<Dashboard />} />
